v. include Licensee's name, trademark and logo in the Titles to identify Licensee as the exhibitor of the Titles.", 'In exchange for the Share Consideration, Licensor hereby grants to Licensee a non-exclusive, royalty-free, perpetual and non-perpetual license (subject to the duration and scope, and format limitations for which Licensor has the rights to each Title as specified in Schedule A1-A6 of Schedule A) to:

