Other than the versions (dubbed or translated) in which the Titles in Schedule A4 already exist in (and were delivered in), no further dubbing, translation, or editing may be performed by any party on Schedule A4's Titles.', 'Licensor hereby grants Licensee a non-exclusive license to use the logos, trademarks and service marks used by Licensor to identify the Titles (collectively, "Licensor Marks") in connection with the use of the Titles as set forth in this Agreement.']

['During the Term and subject to the limitations set forth in this Agreement, Naked shall have an exclusive right and license in the Territory to use Athlete's name, nickname, initials, autograph, image, likeness, photographs, biographical details, facsimile signature, voice, videos, electronic media depictions, any words, symbols or other depictions, as well as any other identifying attributes that would identify Athlete to the public, including any trade mark(s), copyrights which Wade has, as set forth on Schedule A attached hereto, and all multimedia assets that Wade owns or has right to use (collectively, the "Wade Image") solely for the advertising, endorsement, promotion, or sale of the Naked Products (including the Wade Products) in the Territory as follows:<omitted>(1) On Naked's website(s) ("Website");

(2) In social media channels, including, but not limited to Facebook, Instagram, Twitter, YouTube, Google+, Tumblr and other mutually agreeable channels, with reasonable frequency, to promote Naked Products and Wade Products;

(3) In marketing and media opportunities in connection with the Wade Services (as defined below); and

(4) For use on the packaging of the Naked Products and Wade Products and on Wade Products themselves.', 'For the avoidance of doubt, that certain logo designed by Athlete prior to the date hereof (the "Logo") shall remain the sole property of Wade and Naked shall have license during the Term to use the Logo for the advertising, endorsement, promotion, or sale of the Naked Products (including the Wade Products) in the Territory in accordance with the terms and conditions of the Agreement']

["Vendor will provide AT&T, at AT&T's request and cost, with paper and electronic copies of documents and information reasonably necessary to verify Vendor's compliance with this Agreement.", 'The scope of AT&T Audits shall also include:

(i) practices and procedures used in performing the Services;

(ii) systems, communications and information technology used in performing the Services;

(iii) general controls and security practices and procedures;

(iv) supporting information and calculations regarding invoices and compliance with service requirements;

(v) quality initiatives and quality assurance; and

(vi) compliance with the terms of this Agreement.', "AT&T Audits may be conducted once a year (or more frequently if requested by governmental authorities who regulate AT&T's business, if required by applicable Law or if auditors require follow-up access to complete audit inquiries or if an audit uncovers any problems or deficiencies), upon at least ten (10) business days advance notice (unless otherwise mandated by Law) and during business hours. Vendor will cooperate, and will ensure that its Subcontractors cooperate, in the AT&T Audits, and will make the information reasonably required to conduct the AT&T Audits available on a timely basis.", "AT&T's access to the records and other supporting documentation shall include the right to inspect and photocopy Vendor's documentation and the documentation of its Subcontractors as provided to Vendor, and the right to retain copies thereof outside of their physical location with appropriate safeguards, if such retention is deemed reasonably necessary by AT&T and only to the extent that all such records are maintained by AT&T in accordance with Section 3.16 hereof.", "When the FirstNet Authority or other governmental authority requests to review Vendor's records, AT&T and its auditors will review these records first if the FirstNet Authority or other governmental authority permits such review, and provide the records to the requesting governmental authority; provided, however, the FirstNet Authority and other governmental authorities retain the right to perform audits independent of AT&T.", "Failing those efforts, Vendor shall, upon AT&T's request and at AT&T's expense, conduct the audit or inspection on behalf of AT&T, subject to terms agreed to by Vendor and AT&T for the Subcontractor audit, such as areas to be audited, applicable fees, and the timeframe for reporting audit results to AT&T", 'AT&T and its auditors (including internal audit staff and external auditors) and governmental authorities shall have the right to review such records ("AT&T Audits") held and created by Vendor, to verify the following:

(i) the accuracy of Vendor's invoices and AT&T's payment obligations hereunder;

(ii) that the Work charged for was actually performed;

(iii) that the Services have been and are being provided in accordance with this Agreement;

(iv) the integrity of Vendor's systems that process, store, support, maintain, and transmit AT&T data;

(v) Vendor's records relating to the performance of Vendor's Subcontractors with respect to any portion of the Services; and

(vi) that Vendor and its Subcontractors are complying with Section 3.6 hereof.', 'Subject to Subsection (g) below, Vendor shall provide and shall require that its Subcontractors provide to AT&T, its auditors (including internal audit staff and external auditors), and governmental authorities access at all reasonable times to:

(i) any facility at which the Services or any portion thereof are being performed;

(ii) systems and assets used to provide the Services or any portion thereof;

(iii) Vendor employees and Subcontractor employees providing the Services or any portion thereof; and

(iv) all Vendor and Subcontractor records, including financial records relating to the invoices and payment obligations and supporting documentation, pertaining to the Services.', "With respect to AT&T requests for audits or inspections of Vendor's Subcontractors, the following applies:

(i) If Vendor's agreement with its applicable Subcontractor permits an AT&T Audit, AT&T shall be permitted to conduct such audit directly or through a third party representative. Vendor shall work with AT&T in facilitating the Subcontractor's cooperation for an expeditious and thorough audit or inspection.

(ii) If Vendor's contract with its applicable Subcontractor precludes AT&T from directly conducting an audit or inspection, Vendor shall use reasonable best efforts to enable AT&T to perform an audit of the Subcontractor with Vendor coordinating the audit process. Failing those efforts, Vendor shall, upon AT&T's request and at AT&T's expense, conduct the audit or inspection on behalf of AT&T, subject to terms agreed to by Vendor and AT&T for the Subcontractor audit, such as areas to be audited, applicable fees, and the timeframe for reporting audit results to AT&T. If AT&T's request for a Vendor audit or inspection arises from, in AT&T's good faith opinion, materially or consistently deficient Service provided by the Subcontractor under AT&T's account, and the audit in both Parties' opinions confirms such deficiencies, Vendor shall not charge AT&T a fee for the Vendor's audit of its Subcontractor.

(iii) If Vendor's contract with its applicable Subcontractor does not allow Vendor access to the facilities and systems of Subcontractor required to conduct the audit described in Subsection (b) above, then Vendor shall provide a list of such Subcontractors and the services being provided by such Subcontractor to AT&T for its review. To the extent AT&T deems it reasonably necessary to require such access, then Vendor will renegotiate its contract with the applicable Subcontractor in order to obtain the audit rights described in Subsection (b) above.", 'Prior to Location Acceptance, Vendor shall provide AT&T escorted access to the premises wherein all such material is located and, following Location Acceptance, AT&T shall have access to the premises wherein all such material is located pursuant to the terms of the Master License Agreement and the applicable Site License thereunder or any third party Tower Lease, as applicable.', "Vendor shall provide to AT&T (or its third party delegate), upon request and at no charge, its parent company, ATN International, Inc.'s bona fide and unedited: (a) financial statements for each quarter of each fiscal year during the term of the Build Addendum and (b) audited fiscal year financial statements for each fiscal year during the Term hereof.", "AT&T may inspect and inventory the material furnished by AT&T under this Agreement during Vendor's normal business hours."]

