['Subject to the terms and conditions of this Agreement, Zogenix hereby appoints Distributor, and Distributor accepts appointment, as the exclusive distributor (even as to Zogenix) of the Product in the Field in the Territory during the Term, and grants to Distributor the exclusive rights to maintain Regulatory Approval of (while Distributor is the MAH Party), package, promote, market, offer for sale, sell, import and distribute the Product in the Field in the Territory during the Term', "During the Term, Zogenix shall retain and have the sole and exclusive right to supply or have supplied all of Distributors' and its Affiliates' and Sub-distributors' requirements of the Product for sale in the Field in the Territory.", 'Distributor hereby grants Zogenix an irrevocable, perpetual, royalty-free, fully paid-up, exclusive license with the right to grant sublicenses to use such Data solely generated and co-owned by Distributor outside of the Territory and a co-exclusive license in the Territory upon expiration or termination of the Agreement.', 'Distributor shall have the exclusive right to market, promote, sell, offer for sale, import, package and otherwise Commercialize the Product in the Field in the Territory, at its sole cost and expense, in accordance with Applicable Laws and the Commercialization Plan and subject to the terms and conditions of this Agreement.', "Zogenix shall supply (or have supplied) to Distributor, in accordance with the terms set forth on Exhibit 2.3, and Distributor shall purchase exclusively from Zogenix, Distributor's and its Affiliates' and Sub- distributors' Unlabeled Drug Product requirements of the Product for sale by Distributor or its Affiliates or Sub-distributors in the Territory in the Field, subject to and under the provisions of Section 5.2 and the Supply Agreement.", 'Without limiting the foregoing, Distributor will have the exclusive right and responsibility in the Field in the Territory for the following:

(i) designing the Commercialization strategy and tactics for the Product, subject to JSC approval of the Commercialization Plan;

(ii) undertaking all promotional activities for the Product;<omitted>(iii) establishing and implementing post-marketing surveillance studies for the Product in the Territory as required or recommended by a Regulatory Authority;

(iv) receiving, accepting and filling orders for the Product from customers;

(v) warehousing and distributing the Product to customers;

(vi) controlling invoicing, order processing and collection of accounts receivable for sales of the Product;

(vii) recording sales of the Product in the Territory in its books of account for sales; and

(viii) providing results of sales of the Product in the Territory for purposes of periodic safety reports and exposure estimates.']

["To determine  whether  Franchisee  and the Unit are complying with this Agreement and with all Pretzel Time's  standards and operations as prescribed by Pretzel Time,  Pretzel Time or its designated agents shall have the right at any reasonable time and without prior notice to Franchisee to:

         a.  Inspect the Unit;

         b. Observe,  photograph  and video tape the Unit's  operations for such          consecutive or intermittent periods as Pretzel Time deems necessary;

         c. Remove  samples of any  Products,  materials or supplies for testing and analysis;

         d.  Interview personnel of the Unit;

         e.  Interview customers of the Unit; and

         f. Inspect and copy any books,  records and  documents  relating to the          operation  of the Unit.  Franchisee  agrees  to  cooperate  fully  with          Pretzel Time in connection with any such inspections, observations,  photographing,  video  taping,  Product  removal and  interviews. Franchisee  shall present to his customers  such comment or evaluation  forms as Pretzel Time periodically  prescribes and shall  participate  and/or request his customers  to  participate  in any surveys  performed by or on behalf of Pretzel Time.", "The audit will be conducted at the expense of Pretzel Time, provided that if an audit  disclosed an  understatement  of two percent (2%), as described above,  Franchisee will bear the cost of the audit,  including without limitation,  the charges of attorneys  and any  independent  accountants,  their travel   expenses,   room  and  board,   and   compensation  of  Pretzel  Time's representatives  and  independent  accountants.", 'Pretzel  Time or its  designee  shall have the right at any time during business  hours and without prior notice to  Franchisee,  to inspect,  audit and copy or the right to cause to be  inspected,  audited and copied,  the  business records,  bookkeeping and accounting  records,  sales and income tax records and returns and other records of the Franchised Business,  including but not limited to,  daily  cash  reports,  cash  receipts  journal  and  general  ledger,  cash disbursements  journal and weekly payroll register,  monthly bank statements and daily deposit slips and cancelled checks; tax returns,  supplier invoices, dated cash register tapes, weekly inventories, sales reports, financial statements and tax returns and the books and records of any  corporation or  partnership  which holds the Franchise  including the personal financial records and tax returns of the Franchisee during and after the term of the Franchise Agreement.', 'Providing  that in no case will Franchisee be obligated to pay more than ten thousand dollars ($10,000) for such inspection  or audit  costs.', "Franchisee shall fully cooperate with Pretzel Time's representatives and independent accountants hired by Pretzel Time to conduct any such inspection or audit."]

["During the Term of the Agreement, LMG shall maintain and keep in force, at its own expense, the following minimum insurance coverages and minimum limits:

workers' compensation insurance, with statutory limits as required by the various laws and regulations applicable to the employees of LMG;

employer's liability insurance, for employee bodily injuries and deaths, with a limit of $500,000 each accident;

commercial general liability insurance, covering claims for bodily injury, death and property damage, including premises and operations, LMG's vicarious liability for acts of independent contractors, products, services and completed operations (as applicable to the Services), personal injury, contractual, and broad-form property damage liability coverages, with combined single limit of $1,000,000 per occurrence, and a general aggregate limit of $2,000,000, for bodily injury, death and property damage;

commercial automobile liability insurance, covering owned, non-owned and hired vehicles, with combined single limit of $1,000,000 per occurrence;

umbrella liability insurance, with a minimum limit of $5,000,000 per occurrence and $5,000,000 in the aggregate;

special form property insurance, on a replacement cost basis, covering the real and personal property of LMG which LMG is obligated to insure by the Agreement; such real and personal property may include equipment, furniture, fixtures and supply inventory; and

employee dishonesty insurance covering dishonest acts of employees; such insurance shall include a Joint Loss Endorsement in favor of TAG and be written for limits not less than $500,000.", 'TAG shall be named as loss payee as its interest may appear on the property insurance policies of LMG. LMG shall be responsible for payment of any and all deductibles from insured claims under its policies of insurance.', 'All required policies of insurance will be placed with insurers with no less than an A.M. Best rating of A- VII.']

['Within ninety (90) days of our receipt of your notice to renew, we will furnish you with written notice of:  (i) reasons which could cause us not to grant a renewal to you including but not limited to any deficiencies which require correction and a schedule for correction by you; and (ii) our then-current requirements relating to the image, appearance, decoration, furnishing, equipping and stocking of Buffalo Wild Wings businesses, and a schedule for effecting upgrading or modifications in order to bring the Franchised Restaurant in compliance, as a condition of renewal.  Renewal of the franchise shall be conditioned upon your compliance with such requirements and continued compliance with all the terms and conditions of this Agreement up to the date of termination of the initial term.', 'You have the right to renew the franchise for two (2) successive terms equal to five (5) years each, providing you meet all of the following conditions:

            1.    You have, during the entire term, complied with all the provisions of the Agreement;

            2.    The premises of the Franchised Restaurant meet our then-current standards for Buffalo Wild Wings restaurants and you are able to maintain possession of the Franchised Restaurant.  Before the expiration date of this Agreement you must bring the Franchised Restaurant into full compliance with the specifications and standards then applicable for new or renewing Buffalo Wild Wings businesses and present us with evidence satisfactory that you have the right to remain in possession of the Franchised Restaurant premises for the duration of the renewal term.  In the event you are unable to maintain possession of the premises of the Franchised Restaurant or if the premises do not meet our then-current standards, you may secure substitute premises approved by us and provided that you have furnished, stocked and equipped such premises to bring the Franchised Restaurant at its substituted premises into full compliance with the then-current specifications and standards before the expiration date of this Agreement;

            3.    You have given us written notice of your desire to renew at least six (6) months but not more than twelve (12) months prior to the end of the term;

            4.    You have satisfied all of your monetary obligations to us and our affiliates and have timely met these obligations throughout the term of this Agreement;

            5.    You have executed for the renewal term our then-current form of Franchise Agreement (with appropriate modifications to reflect the fact that the agreement relates to the grant of a renewal franchise), which shall supersede in all respects this Agreement, and the terms of which may differ from the terms of this Agreement, including, without limitation, a different percentage Continuing Fee and advertising contribution; provided, however, that the percentage Continuing Fee shall not exceed seven percent (7%) during any renewal period.  You will not be required to pay the then-current initial franchise fee or its equivalent;

            6.    You have complied with our then-current qualification and training requirements; and

            7.    You have executed a general release, in a form prescribed by us, of all claims against us and our affiliates, and respective officers, directors, agents, shareholders and employees.']

['Smith hereby grants to TDA the following rights (the "Rights"):

            (a) the right to use and reuse Smith's name, voice, likeness,       facsimile signature, personal statistics, biographical information and any       reproduction or simulation thereof ("Smith's Likeness") in TDA's Golf       Instruction Related Products and on packaging for TDA's Golf Instruction       Related Products in any fashion, said grant of rights being limited to the       world (the "Contract Territory")";

            (b) the right to use and reuse Smith's Likeness in TDA's general       internal, non-public corporate promotional materials (such as TDA's Annual       Report), corporate advertising and in other forms of publicity;

            (c) the right to use and reuse Smith's Likeness in and in connection       with the marketing, advertising, promoting and publicizing of TDA's Golf       Instruction Related Products, by any and all means now known or hereafter       developed;

            (d) the exclusive right to use and reuse the results and proceeds of       the in connection with TDA's Golf Instruction Related Products; and

            (e) with Smith's prior reasonable approval, the right to license to       third parties any of the foregoing rights but only in connection with or       directly related to the marketing and sale of TDA's Golf Instruction       Related Products.', "Without limiting the foregoing, TDA shall, during the Term (and, Subject to the limitations and conditions on the Rights as set forth in this Agreement, thereafter) have the full and complete right to revise, telecast, broadcast, use, distribute, reproduce, record, publish, print, license, copyright and exhibit the contents of any Results and Proceeds, the Golf Instruction Related Products and any Advertising Materials and any versions or revisions thereof and, in TDA's sole discretion, the Results and Proceeds, the Golf Instruction Related Products and Advertising Materials may be make by any process, instrumentation or device now known or hereafter developed and may be made or adapted for use in any and all media now known or hereafter developed (although it is acknowledged and agreed by TDA that multi-media usage (except, of course, as incorporated into TDA's Golf Instruction Related Products) shall be strictly limited to advertising) provided that any and all such uses are directly related to the marketing, development and sale of TDA's Golf Instruction Related Products."]

['Certificates of Insurance evidencing all coverages described in this Section shall be furnished to Customer upon request.', 'To the extent any insurance coverage required under this Section is purchased on a "claims-made" basis, such insurance shall cover all prior acts of Metavante during the Term, and such insurance shall be continuously maintained until at least four (4) years beyond the expiration or termination of the Term, or Metavante shall purchase "tail" coverage, effective upon termination of any such policy or upon termination or expiration of the Term, to provide coverage for at least four (4) years from the occurrence of either such event.', "Metavante currently maintains and, if available at a reasonable cost, Metavante shall continue to pay for, and maintain in full force and effect during the Term insurance as follows:

A. Workers' compensation and employers' liability insurance with limits to conform with the greater of the amount required by Wisconsin applicable state statutory law or one million dollars ($1,000,000) each accident, including occupational disease coverage;

B. Commercial general liability insurance with limits not less than three million dollars ($3,000,000) combined single limit for bodily injury, death, and property damage, including personal injury, contractual liability, independent contractors, broad-form property damage, and products and completed operations coverage;

C. Commercial automobile liability insurance with limits not less than one million dollars ($1,000,000) each occurrence combined single limit of liability for bodily injury, death, and property damage, including owned and non-owned and hired automobile coverages, as applicable;

D. Commercial Blanket Bond, including Electronic & Computer Crime or Unauthorized Computer Access coverage, in the amount of not less than ten million dollars ($10,000,000); and

E. Professional liability insurance (Errors and Omissions) with limits not less than three million dollars ($3,000,000) annual aggregate for all claims each policy year for computer programming and electronic data processing services."]

['Each Party shall purchase and maintain, at its own expense, the        following insurance coverages:

