          (vi)  will not sublicense, assign or otherwise transfer the Licensed                 Certegy Materials (excluding the Utility Software Programs) to                 any other Person.', 'As of the Closing Date, Equifax and Certegy                           shall each have the perpetual, fully paid, worldwide                           right and license to make, use, sell, copy,                           distribute, import, develop Derivative Works or                           enhancements of, and publicly perform and display, for                           any purpose, the entire APPLY software product (to the                           extent the licensee does not already own the same), in                           both source and object code format, and the                           documentation thereof without any obligation                           (including any obligation to account or pay royalties)                           or liability to the other owner.', "The sublicense rights granted to Equifax pursuant to Section 4.4(a) include the right for Equifax to grant sublicenses to the Licensed Certegy Materials (excluding the Utility<omitted>Software Programs) to the members of the Equifax Group, which sublicenses may include the right to further sublicense such Licensed Certegy Materials (excluding the Utility Software Programs) to such Group member's customers solely for each such customer's internal business purposes to the extent related to the Equifax Business.", 'Equifax hereby grants, and will cause the other members of the Equifax Group to grant, to Certegy a fully paid, non-exclusive, perpetual, worldwide, non-transferable license to use, modify, copy, improve, create Derivative Works and Certegy Enhancements from, and sublicense the Licensed Equifax Materials (excluding the Utility Software Programs) solely for use in the Certegy Business and as that business may evolve and change in the future, subject to the following:

