                shall contain the rights and restrictions set forth in this                 Section 4.1(a) with respect to the license granted to Certegy                 and comply with Sections 4.1(b) through (d) hereof and (B) shall                 be diligently enforced by Certegy.', 'The parties acknowledge and agree that, as between the                           parties, all right, title and interest in and to the





                          trademark or service mark "APPLY," as it relates to                           the APPLY software product, shall be and remain the                           sole and exclusive property of Certegy; provided,                           however, that Certegy shall grant to Equifax a                           perpetual, fully paid, world-wide, exclusive license                           to use the "APPLY" trademark or service mark solely                           for use in combination with the mark "Equifax" and                           solely in connection with the use of the APPLY                           software PRODUCT.', 'Certegy hereby grants to Equifax a fully                           paid, non-exclusive, perpetual, worldwide license to                           use, modify, copy, improve and create Derivative Works                           and enhancements from, in source code and object code                           format, processes or procedures developed by Equifax                           in support to the Paynet Secure software product that                           have applicability independent of or from the Paynet                           Secure software product.']

['In consideration for the purchase of the Products by Distributor from Vendor, Vendor grants Distributor the exclusive right to market, sell, rent, lease, service and maintain the Products and all improvements thereon within the Territory (as defined herein) according to the terms and conditions as set forth herein.', 'In exchange for the marketing and selling of the Products provided in Section 3, Vendor hereby agrees:

4.1. To provide Distributor with the appropriate product brochures, and two (2) fully working and fit for purpose samples of each model of shuffling machine free of charge;

4.2. To prominently display and advertise that Distributor is the sole and exclusive distributor of Vendor for the Products in the Territory;

4.3. Subject to Section 2.6 of this Agreement, not to market, distribute, sell or supply the Products covered by this Agreement to any individual or entity in the Territory directly in response to a request from that person or entity without the prior written consent of Distributor;

4.4. Subject to Section 4.5 of this Agreement, for a period of twenty-four (24) months after the Effective Date, not to develop, manufacture, market, distribute, sell or supply anywhere in the world to any individual or entity a gaming chip-sorting machine for use in a casino; and', 'In exchange for the exclusive distribution right and license granted to Distributor pursuant to this Agreement, during the Term, Distributor hereby agrees to purchase the Products from Vendor, where such Products are fit for purpose and ready for sale in the Territory, as determined by Distributor, as follows:

  5.1.1. As of the Effective Date, one hundred (100) units of the PokerOne™ Shuffler at a price of Four Thousand Nine Hundred Dollars ($4,950.00 U.S.) per unit, where Vendor shall ship the units no later than the end of January 2005;

  5.1.2. Upon the delivery of two (2) units of the Random Plus™ Shuffler to Distributor and the expiration of a review period ending thirty (30) calendar days after the receipt of delivery by Distributor,, where such review by Distributor determines that the Random Plus™ Shuffler is fit for purpose and ready for commercial sale in the Territory, one hundred (100) units of the Random Plus™ Shuffler at a price of Four Thousand Nine Hundred Fifty Dollars ($4,950.00 U.S.) per unit, where Vendor shall ship the units no later than 30 days after the review period;

-5-





  5.1.3. Upon the receipt of any necessary approvals or approval waivers and the expiration of a review period ending thirty (30) calendar days after the receipt of delivery by Distributor of two (2) units of the Continuous Plus™ Shuffler, where such review by Distributor determines that the Continuous Plus™ Shuffler is fit for purpose and ready for commercial sale in the Territory, one hundred (100) units of the Continuous Plus™ Shuffler at a price of Five Thousand Nine Hundred Fifty Dollars ($5,950.00 U.S.);

  5.1.4. Within thirty (30) days of the one (1) year anniversary of the Effective Date, an additional two hundred (200) units of the Products comprising any mix of the shuffler products offered by Vendor; and

  5.1.5. Any additional number of units of the Products as may be submitted by Distributor to Vendor pursuant to a Purchase Order (as defined herein).', 'In exchange for the exclusive distribution right and license provided in Section 2 of this Agreement, Distributor hereby agrees during the Term to use its best commercial efforts to promote, advertise and distribute the Products throughout the Territory, including, without limitation, the following:', 'Distributor shall not obtain, purchase, receive or source any other card shuffling machine from any third party or other source under any circumstance other than from Vendor with the exception of all Shuffle Master, Inc. shuffling machines which are held in stock at the Effective Date which Distributor is free to sell, rent purchase or lease until all of the said stock has been depleted.']

